  false,\n\t\"url\": null,\n\t\"notes\": \"The total documented retrieved harvest
  at Gambell for the spring of 1982 was 942 walruses (Odobenus rosmarus), including
  211 adult males, 404 adult females, 29 adults of unknown sex, and 298 calves. The
  bull harvest was disproportionately lower and the cow and calf harvests slightly
  higher in 1982 than in 1981. Cow:calf ratios in the harvest did not differ significantly
  between years. The number of animals shot and lost was not determined. Lower canine
  teeth unaccompanied by soft tissue specimens were obtained from 117 animals, reproductive
  tracts with teeth were collected from 88 females, and stomachs with teeth were collected
  from 32 animals. The median age of 80 adult male walruses whose teeth were examined
  was 21 years. The median age of 140 adult females was 14 years. The number of man-hours
  spent per walrus retrieved was 8.91. In 1981, 2.3 man-hours were expended per walrus
  retrieved. However, the overall harvest in 1981 (961 walruses) was quite close to
  this year's total. Little or no change in crew, boat, and motor sizes was observed.\",\n\t\"owner_org\":
